export const rightToc = [];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Before we dive in, here is a quick code of conduct to keep in mind:`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`Professionalism`}</strong>{` - We prioritize shipping at all costs. Our main goal is to meet deadlines and deliver valuable output in a timely manner. If you commit to a Save, you should be prepared to do anything and everything to make sure it gets done.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`Respect`}</strong>{` -  Save Dao is a no-beef zone, meaning that we do not discriminate and expect you to withhold all judgement while interacting in or with Save Dao.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`Collaboration`}</strong>{` - Save Dao is meant to foster new relationships. Please be open to inviting new members to your Save as you’re likely to be pleasantly surprised by what you find.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`Honor`}</strong>{` - Becoming a member of Save Dao is no easy feat. We ask that all those involved with Save Dao treat our brand as a seal of honor. This means being kind to others inquiring about the Dao, and speaking favorably about it when presenting on behalf of the Dao in public. If there is something you do not like about the Dao, please vocalize it internally so that we can do our best to resolve it.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`Free Speech`}</strong>{` - Save Dao is an idea meritocracy. We invite you to share your opinion. In fact, we encourage contentious opinions so long as they are presented in a constructive manner.`}</p>
      </li>
    </ul>
    <p>{`With that, let’s learn about the Save Dao!`}</p>
    <p><em parentName="p">{`Note: Is there something you don’t see in the Handbook that you have questions about? Open an issue here to let us know what we should add!`}</em></p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
